import React, { useState, Fragment } from 'react';
import '../styles/Search.css';

const Search = () => {
    const [value, setValue] = useState;

    return (
        <>  
        <form>
            <input className="search-input" type="text" onChange={(event) => setValue(event.target.value)} />
        </form>
        </>
    )
}

export default Search;
